column48:
Gloucestershire County Council requirements are:
*Web portal to enable online bookings, enrolment, course management;
*Manangement Information System to enable relevant information is collected and provided to the Skills Funding Agency and OFSTED;
*Course and Exam  management*The provision of a PCI DSS compliant system;
*Relevant branding to the new portal;
*Minor Configuration Management of the service;
*Hosting of the service;
*Security;
*Business Continuity and Disaster Recovery.
* Maintenance and support of the system, including  system upgrades, patches, testing and release management. Our current software package enables us to provide the Skills Funding Agency and OFSTED  with the information we are required to provide and we  will continue to require this functionality.

Bookings are currently taken based on a paper based process.  In line with the moving transactions to a digital platform, we want a service that provides the following services
*Establishment of user accounts; 
*Records of qualifications awarded;
*Link into the new Gloucestershire County Council Website and to promote Adult Education services;
*An online search functionality for courses provided by the Adult Education Department;
*Course  and Exam Management;
*Booking functionality;

The new portal will need to have Adult Education Department and Gloucestershire County Council , Skill funding Agency, Matrix, European Social Funding Branding.  There may be a requirement for a very small amount of configuration management
